import { Header } from "./components/Header/Header";
import { Footer } from "./components/Footer/Footer";
import { Courses } from "./components/Courses/Courses";
function App() {
  return (
    <>
      <Header />
      <main className="main">
        <Courses/>
      </main>
      <Footer />
    </>
  );
}

export default App;
